import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import images from './React-icon.svg.png';


function Head(){
return (
  <head>
  <nav>
<img src={images} ></img>
<ul>
    <li>
      Pricing.
    </li>
    <li>
      About.
    </li>
    <li>
      Contact.
    </li>
    </ul>
</nav>
</head>

)
}

function Main(){
  return (
    <div>
    <h1>Fun facs about the React.</h1>
    <ul>
      <li>
        It is good to learn React.
      </li>
      <li>
        It is interesting and easy.
      </li>
      <li>
        It is interesting and easy.
      </li>
    </ul>
    </div>

  )
}
 function Foot(){
   return (
      <footer>
        <small>&2022 Shoppy pvt, ltd.</small>
      </footer>
   )
 }

 function Page(){
   return (
     <div>
       <Head/>,
       <Main/>,
       <Foot/>
     </div>
   )
 }
ReactDOM.render(
  <Page/>,
  document.getElementById("root"))
// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
